---including---

ULEAD PhotoImpact X3
Combines full-featured photo editing with inspiring photo projects and amazing digital art to make digital photography and image creativity fun, fast and easy.   

ULEAD MediaStudio Pro 8
Powerful, versatile and intuitive video editing software, for professionals and enthusiasts in independent production, event videography, business, and education. Integrated, quick-to-master tools take you to the forefront of professional real-time HDV, DV or MPEG editing.

ULEAD VideoStudio 11 Plus
Video editing and DVD authoring software for anyone who wants to easily produce professional-looking videos, slideshows and DVDs. Choose the version that&amp;#039;s right for you.

ULEAD GIF Animator 5.05
The industry&amp;#039;s most robust and affordable tool to create animated GIFs. Easily create fast-loading animation for your Web site and PowerPoint presentations.

ULEAD COOL 3D 3.5
A new breed of 3D animation software for high-quality video production. Streamline your 3D text and graphics with advanced tools to produce professional-looking animation.

